import React from 'react';
import GlobalStyle from './globalStyle';
import Main from './screen/main';
import {BrowserRouter, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path='/' component={Main}/>
     </Routes>
    </BrowserRouter>
  );
}

export default App;
